import img1 from './img/previews/Apple AirPods.svg'
import img2 from './img/previews/Apple EarPods.svg'
import img3 from './img/previews/Apple EarPods_.svg'

const wirelessHeadphones = [
    {
        title: 'Apple AirPods',
        img: {img1},
        price: 9527,
        rate: 4.7,
    },
    {
        title: 'GERLAX GH-04',
        img: {img2},
        price: 6527,
        rate: 4.7,
    },
    {
        title: 'BOROFONE BO4',
        img: {img3},
        price: 7527,
        rate: 4.5,
    },  
]

export default wirelessHeadphones;
